intro:
* THẦN DƯỢC QUÝ ÔNG
CỨNG NHƯ TUỔI 20 - Ciatic 20 - Đánh thức bản lĩnh phái mạnh - Xung mãn tuổi 20, kéo dài thời gian quan hệ (lần 2, 3)?
Đánh dấu kỉ niệm hơn 10 năm tham gia diễn đàn cũng như 1 năm sinh hoạt tại box massa...Trong 1 năm thăng trầm thì cũng đã đi cũng sơ sơ được nhiều cơ sở, trải nghiệm nhiều dịch vụ tiện ích, vui nhiều hơn buồn...Để có chút gì thay đổi sau khi đã trải nghiệm từ Tô Hiệu - Thọ Tháp - Nguyễn Khang - Đỗ Quang - Lê Đức Thọ - Đê La Thành - Hào Nam - Ngọc Khánh, nay mình tiếp tục trải nghiệm thêm 1 cơ sở mới...Tranh thủ giá vé đang giảm nên cũng đặt lịch để đến trải nghiệm cũng như có những đánh giá về cơ sở mới này.

1. Khu vực:
- Cơ sở này cũng dễ tìm vì thường xuyên đi làm về khu này...Khuyến khích anh em đi đến cơ sở này vào giờ tan tầm vì lúc đó sẽ lấy cớ tắc đường về muộn.

2. Lễ tân:
- Thấy anh em ở đây nhiệt tình tư vấn cũng như trà nước.

3. Cơ sở vật chất:
- Phòng xông hơi ướt: mặc dù dùng hệ thống điều khiển bằng bảng điện tử nhưng phòng xông hơi ở đây có hơi nhanh hơn so với 1 vài cơ sở có dùng chung hệ thống như thế này;
- Phòng xông hơi khô: đây là lần đầu tiên mình xông và cảm thấy thích thú, thích nhất là nghe tiếng nước xèo xèo và nhìn bảng nhiệt độ..Trong này được lắp đặt tầm 12 tấm đá muối nên cũng gây sự tò mò và kì lạ cho những người đến cơ sở này như mình;
- Trang thiết bị: bồn tắm và bồn rửa mặt bằng đá, hơi khác lạ so với các cơ sở khác dùng thuyền tắm, hệ thống tia nước phun được thiết kế 2 bên và 1 hàng tia nước ở dưới...Bồn ngâm bằng gỗ...Ở đây mình chưa ưng về hệ thống vòi vì ở hơi xa nên làm cho các em cứ chạy ra chạy vào điều chỉnh (chắc chỉ 1-2 bước chân thôi)

- Giường: đặt theo tiêu chuẩn của giường mat-xa nhưng ở dưới có lắp những tấm đá muối...Đây là nét độc đáo cũng như mới lạ cho anh em;

- Ngoài ra phòng có trang bị loa buetooth, ghê mây tre đan,...
- Mình thuộc típ người hơi mê tín nên khi được dẫn vào phòng 7 tầng 3 thì cũng hơi chột dạ vì toàn bị vào 3 ra 7 nên cũng rén...Lần sau khi được dẫn vào phòng chắc phải nói trước để đỡ bị dẫn vào phòng đó...Mặc dù sau đó cũng vui vẻ với em số 12 nhưng vẫn thích số đẹp hơn như tầng 3 thì có thể phòng số 5 hoặc 6 hoặc 8 cũng có thể là 9.

4. Nhân viên: Vì lần đầu đi nên mình đề nghị chọn em nào tình cảm và được tư vấn chọn số 12.
- Vòng 1: ngực đẹp, săn chắc, đầu ti nhỏ - 9 điểm;
- Vòng 2: em này không cao nhưng người săn chắc, không thấy mỡ bụng, mặc dù em này ngồi gập bụng - 8.5 điểm;
- Vòng 3: chẳng sờ mông nên chẳng biết có cong tròn hay không;
- Bím: lông lá được cắt tỉa gọn gàng, sạch sẽ - 9 điểm;
- Kỹ thuật: để anh em có cái nhìn thực tế về công đoạn massa ở đây vì đây là cơ sở có sự khác biệt hoàn toàn so với các cơ sở khác nên anh em đọc kỹ trước khi đi:
+ đầu tiên là mình được ngâm mình trong bồn gỗ, được em 12 tắm và kì cọ cho mình;
+ trong lúc mình ngâm thì em 12 tranh thủ mở nước vào bồn và trải khăn để tý nữa mình nằm lên tấm đá muối đang đỏ đèn;
+ sau đó mình sang bồn tắm thì em 12 cũng thay đồ và vào tắm cùng mình (cái này cũng như các cơ sở khác nên)
+ ở đây thiên về tẩm quất thư giãn nên không có nuru nhé, vì đi sâu vào tẩm quất nên các em ở đây học tương đối bài bản, không khác gì cơ sở Tài Thu;
+ về khoản thư giãn thì khá ổn, nhẹ nhàng...Riêng thái độ thì mình đánh giá cao về em 12 này...Cũng như mọi lần đi massa thì mình cũng chỉ cho các em sử dụng miệng tầm 2-3 phút rồi cho dùng tay là chính...Về kĩ năng dùng tay thì cũng khá ổn, không kiểu nhanh tay để mình ra nhanh.

- Giá cả: 570K tiền vé (đang được khuyến mãi) + 700K dành cho em 12

5. Kết luận và đính hướng tiếp theo: Tiếp tục trải nghiệm các em ở đây...Và tất nhiên sẽ trải nghiệm ở nhiều cơ sở khác nữa./.
